import './styles.css';
import { Link } from 'react-router-dom';
import drinkicon from '../../images/drinkicon.svg';

const Header = () => (
  <div className="header">
    <header>
      <Link to="/login">
        <button src={drinkicon}
          alt="huhu">

        </button>

        />
      </Link>
    </header>
  </div>
);

export default Header;
